import React from "react";
import Slider from "./Slider";
import "../css/Result.css";

function Result() {
  return (
    <div className="result">
      <div className="result-top">
        <div className="result-topHeader">Top Header</div>
        <div className="result-topSlider"></div>
      </div>
      <div className="result-body">
        <div className="result-left">Left</div>
        <div className="result-right">Right</div>
      </div>
      <div className="result-bottom">Bottom</div>
    </div>
  );
}

export default Result;
